      if let model = self?.mModel {
        switch model.prop {
        case .empty :
          return .empty
        case .multiple :
          return .multiple
        case .single (let v) :
          var s = [PackagePad] ()
          for baseObject in v {
            if let object = baseObject as? PackagePad {
              s.append (object)
